export default function Logo() {
  return (
    <div style={{ display: 'flex', alignItems: 'center', gap: '25px' }}>
      <img src="/cropped-___new.png" alt="ОДК Сатурн" style={{ height: '50px', padding:'10px'}} />
      <img src="/rostech.png" alt="Доп. логотип" style={{ height: '50px' }} />
    </div>
  );
}
